import React from 'react'

import styles from './FriendCard.module.css'

const FriendCard = ({user}) => {
    return (
        <>
            <div className={styles.image_wrapper}>
                <img src={user.avatar} />
            </div>
            <div className={styles.name}>{user.username}</div>
        </>
    )
}

export default FriendCard
